import React from 'react'
import axios from 'axios'

export function ViewList(){
  var list;
  var dataKeys;
  axios.get('http://localhost:8000/list').then(
    res=>{
      console.log(res)
      dataKeys = Object.entries(res)
    }
    
  )
  list = dataKeys.map((entry) =>
        <li key={entry.num}>
          {entry}
        </li>
  );
  console.log(list)
  return (
  <div>
      <ul>{list}</ul>
  </div>
  )
}
export default ViewList
